cutoffs.sort()


def createHeatmap(key):
    heatmap = []
    for rowN, cutoff in enumerate(cutoffs):
        row = []
        for colN, depth in enumerate(depths):
            row.append(new_map[(cutoff, depth)][key])
        heatmap.append(row)


    # draw the heatmap
    trace = go.Heatmap(z=heatmap)
    data = [trace]
    py.plot(data, filename=key + '.svg')

